content.css:
* {
  box-sizing: border-box;
}
.container {
  height: 340px;
  width: 1200px;
  overflow-y: auto;
}
table {
  width: 100%;
  border-collapse: collapse;
  border-spacing: 0px;
  padding: 0px;
  position: relative;
  table-layout: fixed;
  font-family: 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif;
}
table thead {
  position: sticky;
  top: 0;
  background-color: #ffffff;
  z-index: 100;
}
table td,
th {
  text-align: center;
  padding: 0px;
}
table td {
  border-left: 1px solid #114b29;
  border-right: 1px solid #114b29;
  overflow: hidden;
  text-overflow: ellipsis;
  white-space: nowrap;
  line-height: 30px;
  max-height: 30px;
  padding: 0px;
  vertical-align: middle;
}
table th {
  min-width: 20px;
  position: relative;
  background-color: #b0d8d5;
  border-left: 1px solid #114b29;
}
table th div.table-header-title {
  overflow: hidden;
  text-overflow: ellipsis;
  white-space: nowrap;
  z-index: 100;
}
table,
td:first-child,
th:first-child {
  text-align: start;
  padding-left: 10px;
}
table th svg,
td svg {
  display: block;
}
table tr:nth-child(even) {
  background: #d5dae7;
}
table tr:nth-child(odd) {
  background: #f8f8f8;
}
table th .resize-handle {
  width: 10px;
  height: 100%;
  cursor: col-resize;
  position: absolute;
  top: 0px;
  right: 0px;
}
table th .resize-handle svg {
  position: absolute;
  bottom: 0;
  right: 0;
  z-index: 0;
}
.resize-handle svg rect {
  fill: #777;
  height: 10px;
}
.resize-handle svg g.handler-icon {
  transform-origin: center center;
  transform: rotate(180deg);
}
span.collapse-sign {
  display: inline-flex;
  justify-content: center;
  align-items: center;
  text-align: center;
  vertical-align: middle;
  margin-left: 5px;
  margin-right: 5px;
}
span.collapse-sign > div {
  display: flex;
  justify-content: center;
  align-items: center;
  width: 16px;
  height: 16px;
  border: 2px solid;
  border-radius: 3px;
  font-size: 14px;
  font-family: Arial, Helvetica, sans-serif;
  font-weight: bold;
  cursor: pointer;
  text-align: center;
}
.milestone-progress {
  width: 10;
  height: 10;
  stroke: black;
  stroke-width: 1px;
  transform-box: fill-box;
  transform-origin: start;
  transform: rotate(45deg);
}
.major-axis-grid line {
  stroke-width: 1;
}
.minor-axis-grid line {
  stroke-dasharray: 2 5;
}
.axis-top .tick path {
  stroke-width: 3;
}
.axis-bottom .tick path {
  stroke-width: 1;
}
div.data-date-marker {
  position: absolute;
  z-index: 100;
  top: 38px;
}
.data-date-marker > .ddm-line {
  position: relative;
  height: 100%;
}
.data-date-marker > .ddm-text {
  position: absolute;
  font-size: 12px;
  background-color: #f8f8f8;
  top: 5px;
  transform: translateX(-50%);
  z-index: 6;
  width: max-content;
}
.data-date-marker > .ddm-triangle {
  position: absolute;
  top: 30px;
}
svg.axis-header {
  position: absolute;
  z-index: 4;
  top: 0;
  background: white;
  border-bottom: solid black 1px;
}
svg.axis-grid {
  position: absolute;
  top: 38px;
  z-index: 1;
  pointer-events: none;
}
svg.horizontal-row {
  position: relative;
  width: 100%;
  z-index: 0;
}
div.progress-container {
  position: relative;
  z-index: 2;
}
.legend {
  display: flex;
  align-items: center;
  flex-direction: row;
  height: 18px;
  gap: 10px;
  margin-top: 10px;
  margin-bottom: 10px;
}
.legend .legend-items {
  display: flex;
  flex-direction: row;
  align-items: center;
  gap: 5px;
  font-size: 15px;
}
.expand-collapse-button {
  cursor: pointer;
  display: inline-flex;
  margin-right: 10px;
  padding: 3px;
  border: solid 2px #424242;
  justify-content: center;
  align-items: center;
  border-radius: 5px;
  font-size: 12px;
  height: 20px;
  width: 20px;
  background-color: lightgray;
  color: #292929;
}
.expand-collapse-button::after {
  content: '\25bc';
}
.expand-collapse-button.collapsed::after {
  content: '\25b6';
}

.container {
  overflow-y: auto;
  cursor: default;
}
.container.empty-background {
  background: url(data:image/svg+xml;base64,) no-repeat center center fixed;
  background-size: contain;
  width: 100%;
  height: 100%;
}
.watermark {
  position: absolute;
  bottom: 20px;
  right: 30px;
  z-index: 10;
}
.watermark a {
  text-decoration: none;
  color: #f3edd1;
  font-weight: bold;
  font-size: x-large;
  letter-spacing: 0px;
  opacity: 55%;
  text-shadow: 5px 4px 11px #000000, 0 2px 5px #000000, 0 0 1em #f2c811;
}
table {
  font-size: var(--taskname-font-size);
  font-family: var(--taskname-font-family);
}
table tr:nth-child(odd) {
  background: var(--table-odd-color);
}
table tr:nth-child(even) {
  background: var(--table-even-color);
}
table tr.lazy-row:hover {
  background: var(--hover-task-color);
}
table tr.lazy-row.selected {
  background: var(--select-task-color);
}
table tr.lazy-row td.name-col span {
  max-height: 30px;
  line-height: 20px;
}
table tr.lazy-row td div.progress-container svg.horizontal-row text {
  pointer-events: none;
}
table th {
  background-color: var(--table-header-background-color);
}
table th .table-header-title svg.axis-header {
  background: var(--timeline-background-color);
}
.legend {
  height: var(--legend-height);
  gap: 10px;
  margin-top: var(--legend-margin-top);
  margin-bottom: var(--legend-margin-bottom);
  margin-left: var(--legend-margin-left);
  margin-right: var(--legend-margin-right);
}
.legend .legend-items {
  font-size: var(--legend-font-size);
  font-family: var(--legend-font-family);
}
div.data-date-marker {
  top: var(--legend-container-height);
}
div.data-date-marker .ddm-triangle {
  display: none;
}
div.data-date-marker .ddm-text {
  top: var(--datadate-title-position);
  font-size: var(--datadate-font-size);
  font-family: var(--datadate-font-family);
}
svg.axis-grid {
  top: var(--legend-container-height);
  pointer-events: none;
}
svg.axis-grid .major-axis-grid line {
  stroke-width: var(--major-grid-width);
  stroke-dasharray: var(--major-grid-dasharray);
}
svg.axis-grid .minor-axis-grid line {
  stroke-width: var(--minor-grid-width);
  stroke-dasharray: var(--minor-grid-dasharray);
}
.alert-box {
  position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  padding: 20px;
  border: 1px solid #ccc;
  background-color: #f2f2f2;
  text-align: center;
  font-size: 25px;
  box-shadow: 0 0 10px 5px rgba(0, 0, 0, 0.3);
  z-index: 999;
}
.alert-icon {
  display: inline-block;
  margin-bottom: 10px;
  font-size: 75px;
  color: red;
}
.alert-box p {
  margin: 0;
}
.alert-box p:first-child {
  margin-top: 0;
}
.alert-box p:last-child {
  margin-bottom: 0;
}
